CREATE TABLE categories (
    category_id integer NOT NULL PRIMARY KEY,
    category_name varchar(255) NOT NULL,
    description text,
    picture text
);

CREATE TABLE customer_demographics (
    customer_type_id integer NOT NULL PRIMARY KEY,
    customer_desc text
);

CREATE TABLE customers (
    customer_id varchar(255) NOT NULL PRIMARY KEY,
    company_name varchar(255) NOT NULL,
    contact_name varchar(255),
    contact_title varchar(255),
    address varchar(255),
    city varchar(255),
    region varchar(255),
    postal_code varchar(255),
    country varchar(255),
    phone varchar(255),
    fax varchar(255)
);

CREATE TABLE customer_customer_demo (
    customer_id varchar(255) NOT NULL,
    customer_type_id integer NOT NULL,
    PRIMARY KEY (customer_id, customer_type_id)
);

CREATE TABLE employees (
    employee_id integer NOT NULL PRIMARY KEY,
    last_name varchar(255) NOT NULL,
    first_name varchar(255) NOT NULL,
    title varchar(255),
    title_of_courtesy varchar(255),
    birth_date date,
    hire_date date,
    address varchar(255),
    city varchar(255),
    region varchar(255),
    postal_code varchar(255),
    country varchar(255),
    home_phone varchar(255),
    extension varchar(255),
    photo text,
    notes text,
    reports_to integer,
    photo_path text
);

CREATE TABLE suppliers (
    supplier_id integer NOT NULL PRIMARY KEY,
    company_name varchar(255) NOT NULL,
    contact_name varchar(255),
    contact_title varchar(255),
    address varchar(255),
    city varchar(255),
    region varchar(255),
    postal_code varchar(255),
    country varchar(255),
    phone varchar(255),
    fax varchar(255),
    homepage text
);

CREATE TABLE products (
    product_id integer NOT NULL PRIMARY KEY,
    product_name varchar(255) NOT NULL,
    supplier_id integer NOT NULL,
    category_id integer NOT NULL,
    quantity_per_unit varchar(255),
    unit_price real,
    units_in_stock integer,
    units_on_order integer,
    reorder_level integer,
    discontinued integer
);

CREATE TABLE region (
    region_id integer NOT NULL PRIMARY KEY,
    region_description text
);

CREATE TABLE shippers (
    shipper_id integer NOT NULL PRIMARY KEY,
    company_name varchar(255) NOT NULL,
    phone varchar(255)
);

CREATE TABLE orders (
    order_id integer NOT NULL PRIMARY KEY,
    customer_id varchar(255),
    employee_id integer,
    order_date date,
    required_date date,
    shipped_date date,
    ship_via integer,
    freight real,
    ship_name varchar(255),
    ship_address varchar(255),
    ship_city varchar(255),
    ship_region varchar(255),
    ship_postal_code varchar(255),
    ship_country varchar(255)
);

CREATE TABLE territories (
    territory_id varchar(255) NOT NULL PRIMARY KEY,
    territory_description text,
    region_id integer
);

CREATE TABLE employee_territories (
    employee_id integer NOT NULL,
    territory_id varchar(255) NOT NULL,
    PRIMARY KEY (employee_id, territory_id)
);

CREATE TABLE order_details (
    order_id integer NOT NULL,
    product_id integer NOT NULL,
    unit_price real,
    quantity integer,
    discount real
);

CREATE TABLE us_states (
    state_id integer NOT NULL PRIMARY KEY,
    state_name varchar(255),
    state_abbr varchar(255),
    state_region varchar(255)
);









